import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css'; // Assuming you have a CSS file for styling

function App() {
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');
  const [date, setDate] = useState('');
  const [timeWindow, setTimeWindow] = useState('');
  const [taskCategory, setTaskCategory] = useState('');
  const [prompt, setPrompt] = useState('');
  const [priority, setPriority] = useState('');
  const [schedules, setSchedules] = useState([]);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    fetchSchedules();
  }, []);

  const fetchSchedules = async () => {
    try {
      const response = await axios.get('http://localhost:5050/schedules');
      setSchedules(response.data);
    } catch (error) {
      console.error('Error fetching schedules:', error);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!title || !description || !date || !timeWindow || !taskCategory || !prompt || !priority) {
      setError('All fields are required');
      return;
    }

    setError('');
    setLoading(true);

    try {
      const response = await axios.post('http://localhost:5050/schedules', {
        title,
        description,
        date,
        timeWindow,
        taskCategory,
        prompt,
        priority,
      });
      setSchedules([...schedules, response.data]);
      setTitle('');
      setDescription('');
      setDate('');
      setTimeWindow('');
      setTaskCategory('');
      setPrompt('');
      setPriority('');
    } catch (error) {
      console.error('Error adding schedule:', error);
      setError('Error adding schedule');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="app">
      <h1>Scheduler</h1>
      <form onSubmit={handleSubmit} className="schedule-form">
        <input
          type="text"
          value={title}
          onChange={(e) => setTitle(e.target.value)}
          placeholder="Title"
        />
        <input
          type="text"
          value={description}
          onChange={(e) => setDescription(e.target.value)}
          placeholder="Description"
        />
        <input
          type="text"
          value={date}
          onChange={(e) => setDate(e.target.value)}
          placeholder="dd/mm/yyyy"
        />
        <input
          type="text"
          value={timeWindow}
          onChange={(e) => setTimeWindow(e.target.value)}
          placeholder="Time Window (e.g., 12pm - 3pm)"
        />
        <input
          type="text"
          value={taskCategory}
          onChange={(e) => setTaskCategory(e.target.value)}
          placeholder="Task Category"
        />
        <input
          type="text"
          value={prompt}
          onChange={(e) => setPrompt(e.target.value)}
          placeholder="Prompt"
        />
        <input
          type="text"
          value={priority}
          onChange={(e) => setPriority(e.target.value)}
          placeholder="Priority"
        />
        <button type="submit" disabled={loading}>
          {loading ? 'Adding...' : 'Add Schedule'}
        </button>
      </form>
      {error && <p className="error">{error}</p>}

      <h2>Schedules</h2>
      <table className="schedule-table">
        <thead>
          <tr>
            <th>Title</th>
            <th>Description</th>
            <th>Date</th>
            <th>Time Window</th>
            <th>Task Category</th>
            <th>Prompt</th>
            <th>Priority</th>
          </tr>
        </thead>
        <tbody>
          {schedules.map((schedule, index) => (
            <tr key={index}>
              <td>{schedule.title}</td>
              <td>{schedule.description}</td>
              <td>{schedule.date}</td>
              <td>{schedule.timeWindow}</td>
              <td>{schedule.taskCategory}</td>
              <td>{schedule.prompt}</td>
              <td>{schedule.priority}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
